INSERT INTO `game_name` (`gn_id`, `name`, `state`, `game_group`, `lottery_type`, `group_type`, `odds`, `guide`, `total_bets`, `model`, `min_rebate`, `max_rebate`, `rebate`, `profit`, `top_price`, `min_bonus`, `sample`, `row`, `start`, `end`, `columnSelection`, `rowSelection`, `showRowName`, `startingPoint`, `endingPoint`, `type`, `row_names`, `isSpecial`, `game_range`, `game_color`) VALUES
(1, 'All 5 Straight (joint)', 'active', 1, 1, 'Straight', '[100000]', 'Game Instructions: Select one number each from the 1st, 2nd, 3rd, 4th, and 5th places to form one bet. If the selected numbers match the drawn numbers exactly and in the correct order, you win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1,1]', 5, 0, 9, 1, 1, 1, 1, 5, 'button', '["1st","2nd","3rd","4th","5th"]', 'false', '', ''),
(2, 'All 5 Straight (Manual)', 'active', 1, 1, 'Straight', '[100000]', 'Game Instructions: Enter one five-digit number to form a single bet. If the entered number matches the drawn number exactly and in the correct order, you win.\nWinning Example: Betting scheme: 12345; Winning numbers: 1,2,3,4,5. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1,1]', 5, 0, 9, 1, 1, 1, 1, 5, 'manual', '[]', 'false', '', ''),
(3, 'All 5 Straight (Combo)', 'active', 1, 1, 'Straight', '[10,100,1000,10000,100000]', 'Game Instructions: Select one number from the 1st, 2nd, 3rd, 4th, and 5th places to form combinations of 1 to 5, totaling 5 bets. If the selected number for the 5th place matches the winning number''s 5th place, you win the 5th position prize. If the selected numbers for the 4th and 5th places match the winning numbers for the 4th and 5th places, you win the 4th and 5th position prizes and so on. Therefore, you can win up to 5 prizes at the same time.\n\nWinning Example: Betting scheme: 1,2,3,4,5; Winning numbers: 1,2,3,4,5. This results in wins for -,-,-,-,5; -,-,-,4,5; -,-,3,4,5; -,2,3,4,5; and 1,2,3,4,5, one bet each.', '500000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1,1]', 5, 0, 9, 1, 1, 1, 1, 5, 'button', '["1st","2nd","3rd","4th","5th"]', 'false', '', ''),
(4, 'All 5 Group 120', 'active', 1, 1, 'Group', '[833.3333]', '\nGame Instructions: Choose 5 numbers to form one bet. If the selected numbers match the winning numbers (order doesn''t matter), it counts as a win.\n\nWinning Example: Betting scheme: 0,2,3,8,9; Winning numbers: 9,8,0,2,3. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[5]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(5, 'All 5 Group 60', 'active', 1, 1, 'Group', '[1666.6666]', 'Game Instructions: Select 1 pair (double number) and 3 single numbers to form one bet. If the winning numbers contain the selected 3 single numbers, and the selected pair appears twice in the winning numbers, it counts as a win.\n\nWinning Example: Betting scheme: Double number: 1, Single numbers: 2,3,4; Winning numbers: 1,2,3,4,1. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,3]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["One Pair", "One No."]', 'false', '', ''),
(6, 'All 5 Group 30', 'active', 1, 1, 'Group', '[3333.3333]', '\nGame Instructions: Choose 2 pairs (double numbers) and 1 single number to form one bet. If the winning numbers contain the selected single number, and each of the selected 2 pairs appears twice in the winning numbers, it counts as a win.\n\nWinning Example: Betting scheme: Double numbers: 2,8, Single number: 0; Winning numbers: 2,8,0,8,2. This results in a win.', '100000\n', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["One Pair", "One No."]', 'false', '', ''),
(7, 'All 5 Group 20', 'active', 1, 1, 'Group', '[5000]', 'Game Instructions: Choose 1 triplet (triple number) and 2 single numbers to form one bet. If the winning numbers contain the selected 2 single numbers, and the selected triplet appears three times in the winning numbers, it counts as a win.\n\nWinning Example: Betting scheme: Triplet: 8, Single numbers: 0,2; Winning numbers: 0,8,2,8,8. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,2]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["Three of a Kind", "One No."]', 'false', '', ''),
(8, 'All 5 Group 10', 'active', 1, 1, 'Group', '[10000]', 'Game Instructions: Choose 1 triplet (triple number) and 1 pair (double number) to form one bet. If the selected triplet appears three times and the selected pair appears twice in the winning numbers, it counts as a win.\n\nWinning Example: Betting scheme: Triplet: 8, Pair: 2; Winning numbers: 2,2,8,8,8. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["Three of a Kind", "One Pair."]', 'false', '', ''),
(9, 'All 5 Group 5', 'active', 1, 1, 'Group', '[20000]', 'Game Instructions: Choose 1 quadruplet (fourfold number) and 1 single number to form one bet. If the winning numbers contain the selected single number, and the selected quadruplet appears four times in the winning numbers, it counts as a win.\n\nWinning Example: Betting scheme: Quadruplet: 8, Single number: 2; Winning numbers: 8,8,2,8,8. This results in a win.', '100000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["Four of a Kind", "One No."]', 'false', '', ''),
(10, 'First 4 Straight(Joint)', 'active', 2, 1, 'Straight', '[10000]', 'Game Instructions: Choose one number from the 1st, 2nd, 3rd, and 4th places to form one bet. If the selected numbers match the winning numbers 1st, 2nd, 3rd, and 4th places respectively, and in the same order, it counts as a win.\n\nWinning Example: Betting scheme: 1,2,3,4; Winning numbers: 1,2,3,4,* (where * represents any number for the units place). This results in a win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 9, 1, 1, 1, 1, 4, 'button', '["1st","2nd","3rd","4th"]', 'false', '', ''),
(11, 'First 4 Straight(Manual)', 'active', 2, 1, 'Straight', '[10000]', 'Game Instructions: Enter a four-digit number to make one bet. If the entered number matches the winning numbers 1st, 2nd, 3rd, and 4th places respectively, and in the same order, it counts as a win.\n\nWinning Example: Betting scheme: 1234; Winning numbers: 1,2,3,4,* (where * represents any number for the units place). This results in a win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 0, NULL, NULL, NULL, 1, 4, 'manual', '', 'false', '', ''),
(12, 'First 4 Straight(Combo)', 'active', 2, 1, 'Straight', '[10,100,1000,10000]', 'Game Instructions: Choose one number from the 1st, 2nd, 3rd, and 4th places to form combinations of 1 to 4 , totaling 4 bets. If the selected number for the 4th place matches the winning number''s 3rd place, you win the 4th place position prize. If the selected numbers for the 3rd and 4th places match the winning numbers for the 3rd and 4th places, you win the 3rd and 4th places positions prizes based on the 3rd and 4th direct selection. Similarly, you can win up to 4 prizes at the same time.\n\nWinning Example: Betting scheme: 1,2,3,4; Winning numbers: 1,2,3,4,* (where * represents any number for the units place). This results in wins for -,-,-,4,; -,-,3,4,; -,2,3,4,; and 1,2,3,4,, one bet each.', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 9, 1, 1, 1, 1, 4, 'button', '["1st","2nd","3rd","4th"]', 'false', '', ''),
(13, 'First 4 Group 24', 'active', 2, 1, 'Group', '[416.6666]', 'Game Instructions: Choose 4 numbers to form one bet. If the selected numbers match the winning numbers 1st, 2nd, 3rd, and 4th places respectively, regardless of the order, it counts as a win.\n\nWinning Example: Betting scheme: 1,2,3,4; Winning numbers: 4,3,2,1,* (where * represents any number for the units place). This results in a win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[4]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(14, 'First 4 Group 12', 'active', 2, 1, 'Group', '[833.3333]', 'Game Instructions: Choose one double number and two single numbers to form a bet. If the two single numbers are included among the 1st, 2nd, 3rd, and 4th places of the winning numbers, and the chosen double number appears twice within these four places, then you win.\n\nFor Example: Betting plan: Double number: 3, Single numbers: 1, 2; Winning numbers: 3, 1, 2, 3, *. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,2]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["One Pair", "One No."]', 'false', '', ''),
(15, 'First 4 Group 6', 'active', 2, 1, 'Group', '[1666.6666]', 'Game Instructions: Select two double numbers to form a bet. If each of the chosen double numbers appears twice among the 1st, 2nd, 3rd, and 4th places of the winning numbers, then you win.\n\nFor example: Betting plan: Double numbers: 2, 8; Winning numbers: 2, 8, 2, 8, *. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(16, 'First 4 Group 4', 'active', 2, 1, 'Group', '[2500]', 'Game Instructions: Select one triple number and one single number to form a bet. If the chosen single number appears in the 1st, 2nd, 3rd, and 4th places of the winning numbers, and the chosen triple number appears three times within these four places, then you win.\n\nFor example: Betting plan: Triple number: 1, Single number: 2; Winning numbers: 1, 2, 1, 1, *. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["Three of a Kind", "One No."]', 'false', '', ''),
(17, 'Last 4 Straight(Joint)', 'active', 2, 1, 'Straight', '[10000]', 'Game Instructions: Select one number from the  2nd, 3rd, 4th and 5th to form a bet. If the chosen numbers match the winning numbers in the  2nd, 3rd, 4th and 5th places, and in the exact order, you win the bet.\n\nExample of winning: Betting plan: 1,2,3,4; Winning numbers: *,1,2,3,4. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 9, 1, 1, 1, 2, 5, 'button', '["2nd","3rd","4th","5th"]', 'false', '', ''),
(18, 'Last 4 Straight(Manual)', 'active', 2, 1, 'Straight', '[10000]', 'Game Instructions: Enter a 4-digit number to form a bet. If the entered number matches the winning numbers in the 2nd, 3rd, 4th and 5th places, and in the exact order, then you win.\n\nFor Example: Betting plan: 1234; Winning numbers: *,1,2,3,4. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 9, NULL, NULL, NULL, 2, 5, 'manual', '[]', 'false', '', ''),
(19, 'Last 4 Straight(Combo)', 'active', 2, 1, 'Straight', '[10,100,1000,10000]', 'Game Instructions: Select one number from each of the  2nd, 3rd, 4th and 5th places to create combinations of 1 to 4 , totaling four bets. If the selected 5th bet number matches the 5th number of the winning numbers, you win the 5th position prize; if the selected 4th and 5th bet numbers match the 4th and 5th numbers of the winning numbers, you win both the  4th and 5th position prizes. This pattern continues such that you can potentially win up to four prizes simultaneously.\n\nFor Example: Betting plan: 1,2,3,4; Winning numbers: ,1,2,3,4. In this case, you win one bet each for ,*,*,*,4 (5th positions),  ,*,*,3,4 ( 4th and 5th positions), ,*,2,3,4 (3rd, 4th and 5th positions), and *,1,2,3,4 (2nd , 3rd, 4th and 5th positions).', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 0, 9, 1, 1, 1, 2, 5, 'button', '["2nd","3rd","4th","5th"]', 'false', '', ''),
(20, 'Last 4 Group 24', 'active', 2, 1, 'Group', '[416.6666]', 'Game Instructions: Choose four numbers to form a bet. If the selected numbers match the winning numbers in the 2nd, 3rd, 4th and 5th places, in any order, then you win.\n\nExample of winning: Betting plan: 1,2,3,4; Winning numbers: *,4,3,2,1. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[4]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(21, 'Last 4 Group 12', 'active', 2, 1, 'Group', '[833.3333]', 'Game Instructions: Select one double number and two single numbers to form a bet. If the two single numbers are included among the 2nd, 3rd, 4th, and 5th places of the winning numbers, and the chosen double number appears twice within these four places, then you win.\n\nFor Example: Betting plan: Double number: 3, Single numbers: 1, 2; Winning numbers: *,3,1,2,3. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,2]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["One Pair","One No."]', 'false', '', ''),
(22, 'Last 4 Group 6', 'active', 2, 1, 'Group', '[1666.6666]', 'Game Instructions: Select two double numbers to form a bet. If each of the chosen double numbers appears twice among the 2nd, 3rd, 4th and 5th places of the winning numbers, then you win.\n\nFor Example: Betting plan: Double numbers: 2, 8; Winning numbers: *,2,8,2,8. In this case, you win.', '10000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(23, 'Last 4 Group 4', 'active', 2, 1, 'Group', '[2500]', 'Game Instructions: Choose one triple number and one single number to form a bet. If the chosen single number is included among the 2nd, 3rd, 4th, and 5th places of the winning numbers, and the chosen triple number appears three times within these four places, then you win.\n\nExample of winning: Betting plan: Triple number: 1, Single number: 2; Winning numbers: *,1,2,1,1. In this case, you win.', '10000\r\n', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 0, 1, 2, 'button', '["Three of a Kind","No."]', 'false', '', ''),
(24, 'First 3 Straight(Joint)', 'active', 3, 1, 'Straight', '[1000]', 'Game Instructions: Select one number each from the 1st, 2nd, and 3rd places to form a bet. If the chosen numbers match the winning numbers in the 1st, 2nd, and 3rd places, and in the exact order, then you win.\n\nFor Examplea: Betting plan: 3, 4, 5; Winning numbers: 3, 4, 5, *, *. In this case, you win.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 0, 9, 1, 1, 1, 1, 3, 'button', '["1st","2nd","3rd"]', 'false', '', ''),
(25, 'First 3 Straight(Manual)', 'active', 3, 1, 'Straight', '[1000]', 'Game Instructions: Enter a 3-digit number to form a bet. If the entered number matches the winning numbers in the 1st, 2nd, and 3rd places, and in the exact order, then you win.\n\nFor Example: Betting plan: 345; Winning numbers: 3, 4, 5, *, *. In this case, you win.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 0, 9, NULL, NULL, NULL, 1, 3, 'manual', '[]', 'false', '', ''),
(26, 'First 3 Straight(Combo)', 'active', 3, 1, 'Straight', '[10,100,1000]', 'Game Instructions: Select one number each from the 1st, 2nd, and 3rd places to form combinations of 1 to 3 , totaling three bets. If the selected 3rd place number matches the 3rd place of the winning numbers, you win the 3rd position prize. If the selected 2nd and 3rd place numbers match the corresponding places of the winning numbers, you win both the 2nd and 3rd positions prizes. Similarly, if all three selected numbers match the winning numbers in the 1st, 2nd, and 3rd places, in the exact order, you can win up to three prizes simultaneously.\n\nFor Example: Betting plan: 1,2,3; Winning numbers: 1,2,3,,. In this case, you win one bet each for ,*,*,3,*, (3rd position prize), ,2,3,,* (2nd and 3rd position prizes), and 1,2,3,, (1st, 2nd and 3rd position prizes).', '5000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 0, 9, 1, 1, 1, 1, 3, 'button', '["1st","2nd","3rd"]', 'false', '', ''),
(27, 'Sum of First 3', 'active', 3, 1, 'Straight', '[1000]', 'Game Instructions: Select one number that will match the sum of the 1st, 2nd, and 3rd places of the winning numbers. If the selected number equals this sum, then you win.\n\nFor Example: Betting plan: 3; Winning numbers: 1, 2, 0, *, *. The sum of 1, 2, and 0 is 3, which matches the selected number, so in this case, you win.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 27, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(28, 'Span of First 3', 'active', 3, 1, 'Straight', '[1000]', 'Game Instructions: Select one number that matches the difference obtained by subtracting the smallest number from the largest number among the 1st, 2nd, and 3rd of the winning numbers. If the selected number equals this difference, then you win.\n\nFor Example: Betting plan: 3; Winning numbers: 1, 2, 4, *, *. The largest number is 4 and the smallest is 1, so the difference is 4 - 1 = 3, which matches the selected number. In this case, you win.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(29, 'First 3 Group 3', 'active', 3, 1, 'Group', '[333.3333]', 'Game Instructions: Select two numbers to form two bets. To win, one of the chosen numbers must appear twice among the 1st, 2nd, and 3rd places of the winning numbers, and the other chosen number must appear once, regardless of the order.\n\nFor Example: Betting plan: 1, 2; Winning numbers: 1, 2, 2, *, *. In this case, you win because the number 2 appears twice and the number 1 appears once in the specified positions.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(30, 'First 3 Group 6', 'active', 3, 1, 'Group', '[166.6666]', 'Game Instructions: Select three numbers to form a single bet. If the chosen numbers match the numbers in the 1st, 2nd, 3rd places of the winning numbers, regardless of order, then you win.\n\nFor Example: Betting plan: 1, 2, 3; Winning numbers: 1, 3, 2, *, *. In this case, you win because the numbers 1, 2, and 3 match the first three numbers of the winning sequence, albeit in a different order.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[3]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(31, 'First 3 Combo Group', 'active', 3, 1, 'Group', '[166.6666,333.3333]', 'Game Instructions: Enter two identical numbers and one different number, or three distinct numbers, to form a single bet. If the entered numbers match the numbers in the 1st, 2nd, and 3rd places of the winning numbers, regardless of order, and there is a pair among these three positions, you win the "Front Three Group Three". If all three numbers are different, you win the "Front Three Group Six".\n\nExamples of winning:\n\nBetting plan A: 122; Winning numbers: 2, 1, 2, *, *. In this case, you win the "Front Three Group Three" because there is a pair (two 2s) among the first three positions.\nBetting plan B: 123; Winning numbers: 1, 3, 2, *, *. In this case, you win the "Front Three Group Six" because all three numbers are different and match the first three positions in any order.', '3000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'manual', '[]', 'false', '', ''),
(32, 'First 3 Sum of Group', 'active', 3, 1, 'Group', '[166.6666,333.3333]', 'Game Insructions: Choose one number that equals the sum of the 1st, 2nd,  3rd places of the winning numbers (excluding cases where all three digits are the same, also known as a "triplet"). If there is a pair among these three positions, you win the "Front Three Group Selected Sum Group Three". If all three numbers are distinct, you win the "Front Three Group Selected Sum Group Six".\n\nFor Example:\n\nBetting plan: 6; Winning numbers A: 3, 3, 0, *, *. In this case, you win the "Front Three Group Selected Sum Group Three" because the sum of the numbers (3+3+0=6) matches the selected number and there is a pair among the numbers.\nWinning numbers B: 1, 2, 3, *, *. In this case, you win the "Front Three Group Selected Sum Group Six" because the sum of the numbers (1+2+3=6) matches the selected number and all numbers are distinct.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 1, 26, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
