(35, 'First 3 Fixed Digit', 'active', 3, 1, 'Group', '[166.6666,333.3333]', 'Game Instructions: Select one number, and if this number matches any one of the 1st, 2nd, or 3rd places of the winning numbers (excluding cases where all three digits are the same, known as a "triplet"), you qualify for a prize. If there is a pair among these three positions, you win a prize. If all three numbers are distinct, you win a prize.\n\nFor Examples:\n\nBetting plan: 3; Winning numbers A: 1, 3, 3, *, *. In this case, you win the prize for this selection because the number 3 matches and forms a pair in the 1st, 2nd, or 3rd places.\nWinning numbers B: 1, 2, 3, *, *. In this case, you win the prize for this selection because the number 3 matches one of the positions and all numbers are distinct, forming no pairs.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 0, 0, 1, 1, 'button', '[]', 'false', '', ''),
