(58, 'Last 3 Sum of Group', 'active', 5, 1, 'Group', '[166.6666,333.3333]', 'Game Instructions: Choose one number that equals the sum of the 3rd, 4th and 5th places of the winning numbers (excluding cases where all three digits are the same, also known as a "triplet"). If there is a pair among these three positions, you win the "last Three Group Selected Sum Group Three". If all three numbers are distinct, you win the "last Three Group Selected Sum Group Six".\n\nFor Example:\n\nBetting plan: 6; Winning numbers A: , *, *, 3, 3, 0. In this case, you win the "Last Three Group Selected Sum Group Three" because the sum of the numbers (3+3+0=6) matches the selected number and there is a pair among the numbers.\nWinning numbers B: , *, *, 1, 2, 3. In this case, you win the "Last Three Group Selected Sum Group Six" because the sum of the numbers (1+2+3=6) matches the selected number and all numbers are distinct.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 1, 26, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(59, 'Last 3 Group 3(Manual)', 'active', 5, 1, 'Group', '[333.3333]', 'Game Instructions: Enter two identical numbers and one different number to form a single bet. If the entered numbers match the numbers in the 3rd, 4th and 5th places of the winning numbers, regardless of order, then you win.\n\nFor Example:\nBetting plan: 122; Winning numbers: , *, *, 2, 1, 2. In this case, you win because the numbers 1 and 2 appear in the last three positions of the winning numbers, matching the bet exactly, even though the order is different.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'manual', '[]', 'false', '', ''),
(60, 'Last 3 Group 6(Manual)', 'active', 5, 1, 'Group', '[166.6666]', 'Game Instructions: Enter three distinct numbers to form a single bet. If the entered numbers match the numbers in the 3rd , 4th and 5th places of the winning numbers, regardless of order, then you win.\n\nFor Example:\n\nBetting plan: 123; Winning numbers: , *, *, 1, 3, 2. In this case, you win the "last Three Group Six" because the numbers 1, 2, and 3 appear in the last three positions of the winning numbers, matching the entered numbers in any order.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'manual', '[]', 'false', '', ''),
(61, 'Last 3 Fixed Digit', 'active', 5, 1, 'Group', '[166.6666,333.3333]', 'Game Instructions: Select one number, and if this number matches any one of the 3rd , 4th and 5th places of the winning numbers (excluding cases where all three digits are the same, known as a "triplet"), you qualify for a prize. If there is a pair among these three positions, you win a prize. If all three numbers are distinct, you win a prize.\n\nFor Examples:\n\nBetting plan: 3; Winning numbers A: , *, * ,1, 3, 3. In this case, you win the prize for this selection because the number 3 matches and forms a pair in the  4th and 5th places.\nWinning numbers B:  *, *, 1, 2, 3. In this case, you win the prize for this selection because the number 3 matches one of the positions and all numbers are distinct, forming no pairs.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 0, 0, 1, 1, 'button', '[]', 'false', '', ''),
(62, 'Last 3 Sum of Tails', 'active', 5, 1, 'Other', '[10]', '\nGame Instructions: Select one number. If this number matches the last digit of the sum of the last three digits (the 3rd , 4th and 5th places) of the winning number, then you win.\n\nFor Example: Betting Option: 3; Winning Numbers: , *, *, 0, 2, 1; Since the sum of the first three digits is 3, which matches the bet, it results in a win.', '1000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(63, 'First 2 Straight(Joint)', 'active', 6, 1, 'Straight', '[100]', 'Game Instructions:\nSelect one number each from the 1st and 2nd places to form one bet. If the chosen numbers match the 1st and 2nd places of the winning number, and in the same order, you win.\n\nWinning Example:\nBetting Scheme: 1,2; Winning Number: 1,2,*,*,*; this results in a win.', '100', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["1st","2nd"]', 'false', '', ''),
(64, 'First 2 Straight(Manual)', 'active', 6, 1, 'Straight', '[100]', 'Game Instructions:\nEnter a two-digit number to make one bet. If the entered number matches the 1st and 2nd places of the winning number, and in the same order, you win.\n\nWinning Example:\nBetting Scheme: 12; Winning Number: 1,2,*,*,*,; this results in a win.', '100', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'manual', '[]', 'false', '', ''),
