(99, 'Fixed place', 'active', 8, 1, 'Fixed place', '[10]', 'Game Instructions:\nChoose one number for any position from 1st , 2nd , 3rd , 4th or 5th to make one bet. If the selected number matches the number in the corresponding position of the winning number, you win.\n\nWinning Example:\nBetting Scheme: 3,-,-,-,-; Winning Number: 3,*,*,*,; this results in a win.', '50', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1,1]', 5, 0, 9, 1, 1, 1, 1, 5, 'button', '["1st","2nd","3rd","4th","5th"]', 'false', '', ''),
