(103, 'Any Place 2 out of Mid 3', 'active', 9, 1, 'All3', '[18.5185]', 'Game Instructions:\nChoose two numbers to make one bet. If the selected two numbers appear in the  2nd, 3rd or 4th place of the winning number, you win.\n\nWinning Example:\nBetting Scheme: 1,3; Winning Number: *,1,3,2,*,; this results in a win.', '45', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
