(114, 'Any Place 3 out of 5', 'active', 9, 1, 'All5', '[22.9884]', 'Game Instructions:\nChoose three numbers to make one bet. If the selected three numbers appear in the 1st, 2nd, 3rd, 4th or 5th  place of the winning number, you win.\n\nWinning Example:\nBetting Scheme: 2,3,5; Winning Number: 1,2,3,4,5; this results in a win.', '120', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[3]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(115, 'B/S/O/E of First 2', 'active', 10, 1, 'Combo', '[4]', 'Game Instructions:\nChoose atleast one selection from the 1st and 2nd places to form a bet. Ranges include:\n\nBig: 5-9\nSmall: 0-4\nOdd: 1,3,5,7,9\nEven: 0,2,4,6,8\nMake one bet with these choices. If the selected forms for the respective positions match the forms and positions of the winning number, you win.\n\nWinning Example:\nBetting Scheme: 1st: Big, 2nd: Small; Winning Number: 9,4,,,*; this results in a win.', '16', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 2, 'card', '["1st","2nd"]', 'false', '', ''),
(116, 'B/S/O/E of First 3', 'active', 10, 1, 'Combo', '[8]', '\nGame Instructions: Choose atleast one form from the 1st, 2nd, and 3rd places (Big: 5-9; Small: 0-4; Odd: 1,3,5,7,9; Even: 0,2,4,6,8) to form a bet. If the selected forms match both the positions and forms of the winning numbers, you win.\n\nWinning Example: Betting Scheme: 1st: Big, 2nd: Small, 3rd: Odd; Winning Number: 9,4,5,*,*,; this results in a win.', '64', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 3, 'card', '["1st","2nd","3rd"]', 'false', '', ''),
(117, 'B/S/O/E of Last 2', 'active', 10, 1, 'Combo', '[4]', 'Game Instructions: Choose one atleast form for the 4th and fifth places (Big: 5-9; Small: 0-4; Odd: 1,3,5,7,9; Even: 0,2,4,6,8) to form a bet. If the selected forms match both the positions and forms of the winning numbers, you win.\n\nWinning Example: Betting Scheme: 4th: Big, 5th: Small; Winning Number: *,*,*,9,4; this results in a win.', '16', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', NULL, NULL, NULL, NULL, NULL, NULL, 4, 5, 'card', '["4th","5th"]', 'false', '', ''),
(118, 'B/S/O/E of Last 3', 'active', 10, 1, 'Combo', '[8]', 'Game Instructions: Choose atleast one form for the 3rd, 4th, and 5th places (Big: 5-9; Small: 0-4; Odd: 1,3,5,7,9; Even: 0,2,4,6,8) to form a bet. If the selected forms match both the positions and forms of the winning numbers, you win.\n\nWinning Example: Betting Scheme: 3rd: Big, 4th: Small, 5th: Odd; Winning Number: ,*,*,9,4,5; this results in a win.', '64', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', NULL, NULL, NULL, NULL, NULL, NULL, 3, 5, 'card', '["3rd","4th","5th"]', 'false', '', ''),
(119, 'B/S/O/E Sum of All 5', 'active', 10, 1, 'Sum', '[2]', 'Game Instructions: Choose one form (Big: 23-45; Small: 0-22; Odd: 1,3,5,7,9; Even: 0,2,4,6,8) to match the sum form of the five winning numbers. If your selected form matches the sum form of the winning numbers, you win.\n\nWinning Example: Betting Scheme: Big; Winning Numbers: 9,8,7,6,9; this results in a win.', '4', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'card', '[]', 'false', '', ''),
(120, 'B/S/O/E Sum of All 3', 'active', 10, 1, 'Sum', '[2]', '\nGame Instructions: Choose one form for the first three, middle three, or last three (forms: Big: 14-27; Small: 0-13; Odd: 1,3,5,7,9; Even: 0,2,4,6,8). If the form of your selection matches the sum form of the corresponding positions of the winning numbers, you win.\n\nWinning Example: Betting Scheme: Front Three: Large; Winning Numbers: 9,8,7,*,*,*; this results in a win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 3, 'card', '["First 3","Middle 3","last 3"]', 'false', '', ''),
(121, 'One Hit', 'active', 12, 1, 'Fun', '[2.4418]', 'Game Instructions: Choose one number to place a bet on. If the selected number appears in the 1st, 2nd, 3rd, 4th or 5th place of the winning number, you win.\n\nWinning Example: Betting Scheme: 1; Winning Number: 9,8,1,2,8; this results in a win.', '10', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
