(123, 'Three Hits', 'active', 12, 1, 'Fun', '[116.8223]', 'Game Instructions: Choose one number to place a bet on. If the selected number appears three times or more in the 1st, 2nd, 3rd, 4th or 5th place of the winning number, you win.\n\nWinning Example: Betting Scheme: 1; Winning Number: 1,8,1,2,1; this results in a win.', '10', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
