(145, 'Dragon/Tiger/Tie', 'active', 16, 1, 'Dragon/Tiger/Tie', '[2.2222,10.0000]', 'Game Instructions: Choose one form from a group of positions to form one bet. Compare the size of the winning numbers in this group of positions. If the former is greater than the latter, it''s "Dragon"; if the former is less than the latter, it''s "Tiger"; if the numbers are the same, it''s "Tie". If the selected form matches the winning form, then you win.\nWinning Example: Betting scheme: 1st, 2nd: Tie; Winning numbers: 0,0,*,*,* — you win.', '30', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 6, 0, 5, NULL, NULL, NULL, NULL, NULL, 'card', '[]', 'true', '', ''),
(146, 'Stud', 'active', 17, 1, 'Stud', '[1.984,222.2222]', 'Game Instructions: Choose one form as one bet. If the selected form matches the winning form, regardless of the order, you win.\nFour of a Kind: One number appears once, and another number appears four times in the winning numbers.\nGourd: One number appears twice, and another number appears three times in the winning numbers.\nStraight: The winning numbers form a sequence of five consecutive numbers. 9 is connected to 0, and 0 is connected to 1.\nThree of a Kind: One number appears three times, and the other two numbers are different in the winning numbers.\nTwo Pairs: Two pairs of double numbers appear in the winning numbers.\nOne Pair: One pair of double numbers appears, and the other three numbers are different in the winning numbers.\nHigh Card: The five numbers in the winning numbers are all different and not in sequence.\nWinning Example: Betting scheme: Straight; Winning numbers: 0,9,1,3,2 — you win.', '7', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'card', '[]', 'true', '', ''),
(147, 'All 3 Three cards', 'active', 18, 1, 'Three cards', '[2.7777,100.0000]', 'Game Instructions: Choose one form as one bet. If the selected form matches the form of the three numbers corresponding to the winning numbers, regardless of the order, you win.\nTOAK: Three numbers are the same;\nStraight: Three consecutive numbers; 9 is connected to 0, and 0 is connected to 1;\nPair: One of the three numbers appears twice, and the other number appears once (e.g., 151, 887);\nHalf-Streak: Three numbers are all different, and only two of them are consecutive (e.g., 238, 769);\nMixed: Three numbers are all different and not consecutive with each other (e.g., 357, 962).\nWinning Example: Betting scheme: Front Three: Leopard; Winning numbers: 0,0,0,*,* — you win.', '15', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'card', '["First 3","Middle 3","Last 3"]', 'true', '', ''),
(148, 'Bull Bull', 'active', 19, 1, 'Bull Bull', '[2.8051,15.6862]', 'Game Instructions: Choose one form as one bet. If the selected form matches the form of the winning numbers, you win.\n\n1. No Bull: The sum of any three digits in the winning numbers cannot be a multiple of 0 or 10.\n2. Bull Bull: The sum of any three digits in the winning numbers can be a multiple of 0 or 10, and the units digit of the sum of the other two numbers is 0.\n3. Bull 1 to Bull 9: The sum of any three digits in the winning numbers can be a multiple of 0 or 10, and the units digit of the sum of the other two numbers matches the selected number.\n4. Big Bull: Bull Bull, Bull 9, Bull 8, Bull 7, Bull 6.\n5. Small Bull: Bull 5, Bull 4, Bull 3, Bull 2, Bull 1.\n6. Odd Bull: Bull 1, Bull 3, Bull 5, Bull 7, Bull 9.\n7. Even Bull: Bull 2, Bull 4, Bull 6, Bull 8, Bull Bull.\nWinning Example: Betting scheme: Bull 1; Winning numbers: 9,0,1,1,0 — you win.', '15', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'card', '[]', 'true', '', ''),
