(357, 'Dragon/Tiger/Tie\n', 'active', 50, 5, 'Dragon/Tiger/Tie\n', '[[2.2221299999999999,10]]', 'Game Instructions: Choose one pattern from a set of options based on the comparison of numbers in specific positions. In this set, you compare two positions (e.g., 1st and 2nd). If the number in the first position is greater than the number in the second position , it is called "Dragon." If the number in the first position is less than the number in the second position, it is called "Tiger." If both numbers are the same, it is called a "Tie." You win if the pattern you selected matches the outcome of this comparison.\n\nExample of winning: Betting scheme: Dragon ( between 1st and 2nd ); Winning numbers: 2, 1, * (where "*" can be any number). Since the number in the 1st place (2) is greater than the number in the 2nd place (1), the result is "Dragon," matching the bet, resulting in a win.', '9', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, 4, 0, 3, NULL, NULL, NULL, NULL, NULL, 'card', '', 'true', '', ''),
(358, 'First 1 straight(joint)', 'active', 101, 2, 'First1', '[10]', 'Game Instructions: Choose one number to form a single bet. If the selected number matches the "Champion" number (the first number) of the winning numbers, you win.\n\nExample of winning: Betting scheme: 1; Winning numbers: 1, *, *, *, *, *, *, *, *, , (where "" can be any number). Since the first number of the winning sequence is 1, which matches the selected number, this results in a win.', '10', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 1, 10, 0, 1, 0, 1, 1, 'button', '', 'false', '', ''),
(359, 'First 2 straight(joint)', 'active', 101, 2, 'First2', '[90]', 'Game Instructions: Choose two distinct numbers, one for the champion (first place) and one for the runner-up (second place), to make a bet. If the selected numbers match the first two numbers of the winning numbers in the same order, you win.\n\nExample of winning: Betting scheme: 1, 2; Winning numbers: 1, 2, *, *, *, *, *, *, *, , (where "" can be any number). Since the first two numbers of the winning sequence are 1 and 2, matching the selected numbers in order, this results in a win.\n', '90', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 1, 10, 1, 1, 1, 1, 2, 'button', '', 'false', '', ''),
(360, 'First 2 straight(manual)', 'active', 101, 2, 'First2', '[90]', 'Game Instructions: Enter two distinct numbers from 01 to 10. If these entered numbers match the first two numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 01, 02; Winning numbers: 1, 2, *, *, *, *, *, *, *, , (where "" can be any number). Since the first two numbers of the winning sequence are 1 and 2, matching the entered numbers in order (considering 01 as 1 and 02 as 2), this results in a win.', '90', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 1, 10, 1, 1, 1, 1, 2, 'manual', '[]', 'false', '', ''),
(361, 'First 3 straight(joint)', 'active', 101, 2, 'First3', '[720]', 'Game Instructions: Choose one distinct number each for the champion (first place), the runner-up (second place), and the third place to form a single bet. If the selected numbers match the first three numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 1, 2, 3; Winning numbers: 1, 2, 3, *, *, *, *, *, *, , (where "" can be any number). Since the first three numbers of the winning sequence are 1, 2, and 3, matching the selected numbers in order, this results in a win.', '720', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 10, 1, 1, 1, 1, 3, 'button', '', 'false', '', ''),
(362, 'First 3 straight(manual)', 'active', 101, 2, 'First3', '[720]', 'Game Instructions: Enter three distinct numbers from 01 to 10. If these entered numbers match the first three numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 01, 02, 03; Winning numbers: 1, 2, 3, *, *, *, *, *, *, , (where "" can be any number). Since the first three numbers of the winning sequence are 1, 2, and 3, matching the entered numbers in order (considering 01 as 1, 02 as 2, and 03 as 3), this results in a win.', '720', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 10, 1, 1, 1, 1, 3, 'manual', '[]', 'false', '', ''),
(363, 'First 4 straight(joint)', 'active', 101, 2, 'First4', '[504]', 'Game Instructions: Choose one distinct number each for the champion (first place), the runner-up (second place), the third place, and the fourth place to form a single bet. If the selected numbers match the first four numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 1, 2, 3, 4; Winning numbers: 1, 2, 3, 4, *, *, *, *, *, , (where "" can be any number). Since the first four numbers of the winning sequence are 1, 2, 3, and 4, matching the selected numbers in order, this results in a win.', '5040', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, NULL, '[1,1,1,1]', 4, 1, 10, 1, 1, 1, 1, 4, 'button', '', 'false', '', ''),
(364, 'First 4 straight(manual)', 'active', 101, 2, 'First4', '[504]', 'Game Instructions: Enter four distinct numbers from 01 to 10. If these entered numbers match the first four numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 01, 02, 03, 04; Winning numbers: 1, 2, 3, 4, *, *, *, *, *, , (where "" can be any number). Since the first four numbers of the winning sequence are 1, 2, 3, and 4, matching the entered numbers in order (considering 01 as 1, 02 as 2, 03 as 3, and 04 as 4), this results in a win.', '5040', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1]', 4, 1, 10, 1, 1, 1, 1, 4, 'manual', '[]', 'false', '', ''),
(365, 'First 5 straight(joint)', 'active', 101, 2, 'First5', '[30240]', 'Game Instructions: Choose one distinct number each for the champion (first place), the runner-up (second place), the third place, the fourth place, and the fifth place to form a single bet. If the selected numbers match the first five numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 1, 2, 3, 4, 5; Winning numbers: 1, 2, 3, 4, 5, *, *, *, *, , (where "" can be any number). Since the first five numbers of the winning sequence are 1, 2, 3, 4, and 5, matching the selected numbers in order, this results in a win.', '30240', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, NULL, '[1,1,1,1,1]', 5, 1, 10, 1, 1, 1, 1, 5, 'button', '', 'false', '', ''),
(366, 'First 5 straight(manual)', 'active', 101, 2, 'First5', '[30240]', 'Game Instructions: Enter five distinct numbers from 01 to 10. If these entered numbers match the first five numbers of the winning numbers in the exact order, you win.\n\nExample of winning: Betting scheme: 01, 02, 03, 04, 05; Winning numbers: 1, 2, 3, 4, 5, *, *, *, *, , (where "" can be any number). Since the first five numbers of the winning sequence are 1, 2, 3, 4, and 5, matching the entered numbers in order (considering 01 as 1, 02 as 2, 03 as 3, 04 as 4, and 05 as 5), this results in a win.', '30240', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1,1,1]', 5, 1, 10, 1, 1, 1, 1, 5, 'manual', '[]', 'false', '', ''),
(367, 'First 5 Fixed Place', 'active', 102, 2, 'Fixed place', '[10]', 'Game Instructions: Choose one number from any position among the champion (first place), the runner-up (second place), the third place, the fourth place, or the fifth place. If the selected number matches the number in the corresponding position of the winning numbers, you win.\n\nExample of winning: Betting scheme: Champion (1st place) 1; Winning numbers: 1, *, *, *, *, *, *, *, , * (where "" can be any number). Since the selected number matches the number in the champion position of the winning numbers, this results in a win.', '50', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 5, 1, 10, 1, 1, 1, 1, 5, 'button', '', 'false', '', ''),
(368, 'Last 5 Fixed Place', 'active', 102, 2, 'Fixed place', '[10]', 'Game Instructions: Choose one number from any position among the sixth place, seventh place, eighth place, ninth place, or tenth place. If the selected number matches the number in the corresponding position of the winning numbers, you win.\n\nExample of winning: Betting scheme: Sixth place 1; Winning numbers: *, *, *, *, *, 1, *, *,*, * (where "*" can be any number). Since the selected number matches the number in the sixth place of the winning numbers, this results in a win.', '50', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 5, 1, 10, 1, 1, 1, 6, 10, 'button', '', 'false', '', ''),
(369, 'Dragon/Tiger', 'active', 103, 2, 'Dragon/Tiger', '[2]', 'Game Instructions: Choose one pattern from a set of options based on the comparison of numbers in specific positions. In this set, you compare two positions (e.g., 1 to 10). If the number in the first position is greater than the number in the second position, it is called "Dragon." If the number in the first position is less than the number in the second position, it is called "Tiger." You win if the pattern you selected matches the outcome of this comparison.\n\nExample of winning: Betting scheme: 1 vs 10, Dragon; Winning numbers: 10, *, *, *, *, *, *, *, *, 1. Since the number in the first position (10) is greater than the number in the second position (1), the result is "Dragon," matching the bet, resulting in a win.', '10', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'card', '', 'true', '', ''),
(370, 'Pick 2(Joint)', 'active', 104, 2, 'Straight', '[90]', 'Game Instructions: Choose any two positions from ten positions available. Then select one distinct number for each of these two chosen positions to form a single bet. If the selected numbers match the numbers in the corresponding positions of the winning numbers, and the order is the same, you win.\n\nExample of winning: Betting scheme: Champion 1, Runner-up 2; Winning numbers: 1, 2, *, *, *, *, *, *,*, * (where "*" can be any number). Since the selected numbers match the numbers in the champion and runner-up positions of the winning numbers, and the order is the same, this results in a win.', '4050', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 10, 1, 10, 1, 1, 1, 1, 10, 'button', '', 'false', '', ''),
(371, 'Pick 2(Manual)', 'active', 104, 2, 'Straight', '[90]', 'Game Instructions: Choose any two positions from ten available positions. Then, enter two distinct numbers from 01 to 10 to form a single bet. If the numbers entered match the numbers in the corresponding positions that were chosen, and the order is the same, you win.\n\nExample of winning: Betting scheme: (Champion (1st place), Runner-up) 01, 02; Winning numbers: 1, 2, *, *, *, *, *, *,*, * (where "*" can be any number). Since the numbers entered match the numbers in the champion and runner-up positions that were chosen, and the order is the same, this results in a win.', '4050', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 1, 10, 1, 1, 1, 1, 10, 'manual', '[]', 'false', '', ''),
(372, 'Pick 3(Joint)', 'active', 104, 2, 'Straight', '[720]', 'Game Instructions: Choose any three positions from ten available positions. Then, select one distinct number for each of these three chosen positions to form a single bet. If the numbers selected match the numbers in the corresponding positions that were chosen, and the order is the same, you win.\n\nExample of winning: Betting scheme: (Champion(1st place) 1, Runner-up(2nd place) 2, Third(3rd place) place 3); Winning numbers: 1, 2, 3, *, *, *, *, *,*, * (where "*" can be any number). Since the numbers selected match the numbers in the 1st, 2nd, and 3rd place positions that were chosen, and the order is the same, this results in a win.', '86400', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 10, 1, 10, 1, 1, 1, 1, 10, 'button', '', 'false', '', ''),
(373, 'Pick 3(Manual)', 'active', 104, 2, 'Straight', '[720]', 'Game Instructions: Choose any three positions from ten available positions. Then, enter three distinct numbers from 01 to 10 to form a single bet. If the numbers entered match the numbers in the corresponding positions that were chosen, and the order is the same, you win.\n\nExample of winning: Betting scheme: (Champion(1st place) 01, Runner-up(2nd place) 02, Third place(3rd place) 03); Winning numbers: 1, 2, 3, *, *, *, *, *, , * (where "" can be any number). Since the numbers entered match the numbers in the champion (1st), runner-up(2nd), and third place positions that were chosen, and the order is the same, this results in a win.', '86400', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 10, 1, 1, 1, 1, 10, 'manual', '[]', 'false', '', ''),
(374, 'B/S/O/E of First 5', 'active', 105, 2, 'B/S/O/E', '[2]', 'Game Instructions: Choose one form from the options available for the positions of the champion(1st), runner-up(2nd), third place, fourth place, and fifth place. The available forms are: "Big" (6-10), "Small" (1-5), "Odd" (single digits 1, 3, 5, 7, 9), and "Even" (single digits 0, 2, 4, 6, 8). If the form selected for the chosen position matches the form of the corresponding position in the winning numbers, you win.\n\nExample of winning: Betting scheme: Position: Champion(1st), Form: Odd; Winning numbers: 1, *, *, *, *, *, *, *,*, * (where "*" can be any number). Since the form selected for the champion position matches the form of the first digit in the winning numbers (which is an odd number), this results in a win.', '20', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 5, 'card', '', 'false', '', ''),
(375, 'B/S/O/E sum of Top Two', 'active', 105, 2, 'B/S/O/E', '[1.8,2.2499500000000001]', '\nGame Instructions: Choose one form from the options available: "Big" (sum of the champion(1st) and runner-up(2nd)  numbers is 12-19), "Small" (sum of the champion(1st) and runner-up(2nd) numbers is 3-11), "Odd" (sum of the champion(1st) and runner-up(2nd)  numbers results in an odd number), or "Even" (sum of the champion(1st) and runner-up(2nd)  numbers results in an even number). If the form selected matches the form of the sum of the champion(1st) and runner-up(2nd) numbers in the winning numbers, you win.\n\nExample of winning: Betting scheme: Big; Winning numbers: 10, 9, *, *, *, *, *, *,*, * (where "*" can be any number). Since the sum of the champion(1st) and runner-up(2nd) numbers is 10 + 9 = 19, falling within the range of 12-19 (Big), this results in a win.\n', '4', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'card', '', 'false', '', ''),
(376, 'Sum of Top Two', 'active', 106, 2, 'Sum', '[9,11.24995,15,22.5,45]', 'Game Instructions: Choose one number. If this number matches the sum of the champion(1st) and runner-up(2nd) numbers in the winning numbers, you win.\n\nExample of winning: Betting scheme: 3; Winning numbers: 1, 2, *, *, *, *, *, *,*, * (where "*" can be any number). Since the sum of the champion and runner-up numbers is 1 + 2 = 3, matching the selected number, this results in a win.', '17', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 3, 19, 0, 1, 0, 1, 1, 'card', '', 'true', '', ''),
(378, 'Sum of First 3', 'active', 106, 2, 'Sum', '[12,13.333299999999999,15,17.14274,24,30,40,60,120]', '\nGame Instructions: Choose one number. If this number matches the sum of the champion(1st), runner-up(2nd), and third place(3rd) numbers in the winning numbers, you win.\n\nExample of winning: Betting scheme: 6; Winning numbers: 1, 2, 3, *, *, *, *, *,*, * (where "*" can be any number). Since the sum of the champion, runner-up, and third place numbers is 1 + 2 + 3 = 6, matching the selected number, this results in a win.', '22', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 6, 27, 0, 1, 0, 1, 1, 'card', '', 'true', '', ''),
(379, 'Extra No.', 'active', 121, 8, '', '[49]', 'Game instructions: Choose one number from 49 numbers to form one bet. If the selected number matches the special code(Extra Number) in the draw, you win.\n\nExample of winning: Betting scheme: 01; Special code in draw: 01, you win.', '49', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 1, 49, 0, 1, 0, 1, 1, 'mark6', '', 'false', '', '');
