(380, 'Extra head/tail no.', 'active', 121, 8, '', '[4.9, 5.44396, 9.8, 12.24995]', 'Game instructions: Choose one number to form one bet, where the 1st digit represents the head and the 2nd digit represents the tail. If the selected number matches the corresponding position of the Special code(Extra Number) in the draw, you win.\n\nExample of winning: Betting scheme: Head 1; Special code in draw: 10, you win.', '15', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 0, 9, 0, 0, 1, 1, 2, 'mark6', '', 'false', '', ''),
(382, 'Combo Zodiac', 'active', 122, 8, '', '[6]', 'Game instructions: Choose two zodiac signs to form one bet. If the special code(Extra Number) in the draw falls within the number range associated with the selected zodiac signs, you win. If the special code is 49 (draw), your bet is refunded.\n\nExample of winning: Betting scheme: Dragon, Tiger; Special code in draw: Falls within the number range associated with Dragon or Tiger, you win.', '66', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 12, 0, 0, 0, 1, 1, 'mark6', '', 'false', '', ''),
(383, 'Special Zodiac', 'active', 122, 8, '', '[9.8000000000000007,12.24995]', 'Game instructions: Choose one zodiac sign to form one bet. If the special code(Extra Number) in the draw falls within the number range associated with the selected zodiac sign, you win.\n\nExample of winning: Betting scheme: Dragon; Special code in draw: Falls within the number range associated with Dragon, you win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 12, 0, 0, 0, 1, 1, 'mark6', '', 'false', '', ''),
