(385, 'Form Extra No.', 'active', 122, 8, '', '[2.0000,4.0000]', 'Game instructions: Choose one form (Small: 01-24, Big: 25-48; Odd: single digits 1, 3, 5, 7, 9, Even: single digits 0, 2, 4, 6, 8). If the selected form matches the form of the special code(Extra Number) in the draw (Special code 49 is a draw and refunds the bet), you win.\n\nExample of winning: Betting scheme: Small; Special code in draw: 02, you win.', '6', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 2, 'mark6', '', 'false', '', ''),
(386, 'Form Sum of extra head & tail', 'active', 122, 8, '', '[2]', 'Game instructions: Choose one form (Small: 1-6, Big: 7-12; Odd: single digits 1, 3, 5, 7, 9, Even: single digits 0, 2, 4, 6, 8). If the selected form matches the form of the sum of the special code''s (Extra Number''s) first and second digits in the draw (Special code 49 is a draw and refunds the bet), you win.\nExample of winning: Betting scheme: Small; Special code in draw: 02, you win.', '4', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
