(389, 'Color Balls', 'active', 123, 8, '', '[2.8822000000000001,3.0600000000000001]', 'Game instructions: Choose one color to form one bet. If the selected color matches the color of the special code(Extra Number) in the winning number, you win.\n\nExample of winning: Betting scheme: Red color; Special code in draw: 01, you win.', '3', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'mark6', '', 'false', '', ''),
