(392, '2 Side Colored Balls', 'active', 123, 8, '', '[4.7999999999999998,5.3333000000000004,6,6.8570599999999997]', 'Game instructions: Choose one colored balls(red,blue,green) with it''s form (Small: 01-24, Big: 25-48; Odd: single digits 1, 3, 5, 7, 9, Even: single digits 0, 2, 4, 6, 8) to form one bet. If the selected colored balls form matches both the color and form of the special code(Extra Number) in the draw (Special code 49 is a draw and refunds the bet), you win.\n\nExample of winning: Betting scheme: Red odd; Special code in draw: 19, you win.', '1', 'standard', '0.000', '15.000', '15.000', '0.000', 17000, 0, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'mark6', '', 'false', '', ''),
