(421, 'Sum', 'active', 127, 8, 'Extra Ball No.', '[2]', '\nGame instructions: Select one form (Big: >175, Small: <175, Odd: last digit 1,3,5,7,9, Even: 0,2,4,6,8). If it matches the form of the sum of the seven numbers, you win (if the sum is 175, bets on ''Big'' and ''Small'' will have their principal refunded);\nWinning example: Betting scheme: Odd; Drawn numbers: Sum = 171, you win.', '4', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, NULL, NULL, NULL, NULL, 1, 1, 6, 'mark6', '', 'false', '', ''),
(422, 'Tail No.', 'active', 127, 8, 'Extra Ball No.', '[1.80528,2.1198999999999999]', 'Game instructions: Select one last digit. If the last digit of any of the seven drawn numbers includes the selected last digit, you win. If it is a 0 ending, you win the 0 ending prize; for 1-9 endings, you win the corresponding 1-9 ending prize. Regardless of how many times the same ending appears, you win only once.\nWinning example: Betting scheme: 1; Drawn numbers include 1 as the last digit, you win.', '9', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, 0, 9, NULL, NULL, 0, 1, 1, 'mark6', '', 'false', '', ''),
