(424, 'Mismatch', 'active', 127, 8, 'Extra Ball No.', '[2.24152,2.6656900000000001,3.1839599999999999,3.8207100000000001,4.6074000000000002,5.5847699999999998,6.8064999999999998]', 'Game instructions: Choose between 5 to 11 numbers to form a bet. If none of the 5 selected numbers from any combination of the chosen 5-11 numbers are in the current winning numbers, you win the seventh prize. If none of the 6 selected numbers are in the winning numbers, you win the sixth prize, and so on. If none of the 11 selected numbers are in the winning numbers, you win the first prize.\nWinning example: Betting scheme: 01, 02, 03, 04, 05; Drawn numbers: 06, 07, 08, 09, 10, 11+12, you win.', '1', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[5]', 1, 1, 49, NULL, NULL, 0, 1, 1, 'mark6', '', 'false', '', ''),
