(426, '3 Consec tail', 'active', 127, 8, 'Extra Ball No.', '[7.3405100000000001,8.7444699999999997]', 'Game instructions: Choose three last digits to form one bet. If all three selected last digits appear among the last digits of the drawn numbers, you win. If it includes a 0 ending, you win the 0 ending prize; if it does not include a 0 ending, you win the 1-9 ending prize. Regardless of how many times the same ending appears, you win only once.\nWinning example: Betting scheme: 1, 2, 3; Drawn numbers: 06, 07, 08, 09, 13, 11+12, you win.', '120', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, NULL, NULL, 0, 1, 1, 'mark6', '', 'false', '', ''),
(427, '4 Consec tail', 'active', 127, 8, 'Extra Ball No.', '[17.366700000000002,20.872990000000001]', 'Game instructions: Choose four last digits to form one bet. If all four selected last digits appear among the last digits of the drawn numbers, you win. If it includes a 0 ending, you win the 0 ending prize; if it does not include a 0 ending, you win the 1-9 ending prize. Regardless of how many times the same ending appears, you win only once.\nWinning example: Betting scheme: 1, 2, 3, 4; Drawn numbers: 06, 07, 08, 04, 13, 11+12, you win.', '210', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[4]', 1, 0, 9, NULL, NULL, 0, 1, 1, 'mark6', '', 'false', '', ''),
