(429, '2 No.', 'active', 127, 8, 'Extra Ball No.', '[37.93533,63.225790000000003]', 'Game instructions: Select two numbers to form one bet. If the winning numbers include both of your selected numbers, and both are regular numbers(if the number is not Extra Ball) in the draw, then you win "two regulars". If one of them is a regular number and the other is a special number, then you win "one special, one regular".\nWinning example: Betting scheme: 06, 07; Drawn numbers: 06, 07, 05, 04, 13, 11+12, you win.', '49', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 1, 49, 1, 1, 0, 1, 1, 'mark6', '', 'false', '', ''),
(430, 'Win Extra No.', 'active', 127, 8, 'Extra Ball No.', '[196]', 'Game instructions: Choose two numbers to form one bet. If one of your selected numbers matches the special number(Extra Number) in the draw, and the other matches any regular number, then you win.\nWinning example: Betting scheme: 01, 02; Drawn numbers include 01 as a regular number and 02 as the special number, or vice versa, you win.', '49', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 1, 49, 1, 1, 0, 1, 1, 'mark6', '', 'false', '', ''),
(431, '1 Zodiac', 'active', 128, 8, 'Same line extra & Ball Zodiac', '[1.8052699999999999,2.1198899999999998]', 'Game instructions: Select one zodiac sign to form one bet. If any of the zodiac signs corresponding to the seven winning numbers include this selected zodiac sign, you win. If the betted zodiac sign is not the current zodiac year, you win the first prize; if it is the current zodiac year, you win the second prize. Regardless of how many times the same zodiac sign appears among the winning numbers, you win only once.\nWinning example: Betting scheme: Dragon; winning numbers fall within the range of numbers corresponding to the Dragon zodiac sign, you win.', '66', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
(432, '2 Consec zodiac', 'active', 128, 8, 'Same line extra & Ball Zodiac', '[4.1210199999999997,4.8741099999999999]', '\nGame instructions: Select two zodiac signs to form one bet. If the zodiac signs corresponding to any of the seven wining numbers include both of these selected zodiac signs (in any order), you win. If the bet does not include a zodiac sign from the current zodiac year, you win the first prize; if it includes the current zodiac year, you win the second prize. Regardless of how many times the same zodiac signs appear among the drawn numbers, you win only once.\nWinning example: Betting scheme: Dragon, Tiger; Drawn numbers include numbers corresponding to the Dragon and Tiger zodiac signs, you win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
(433, '3 Consec zodiac', 'active', 128, 8, 'Same line extra & Ball Zodiac', '[10.422029999999999,12.42751]', 'Game instructions: Select three zodiac signs to form one bet. If the zodiac signs corresponding to any of the seven winning numbers include all three of these selected zodiac signs (in any order), you win. If the bet does not include a zodiac sign from the current zodiac year, you win the first prize; if it includes the current zodiac year, you win the second prize. Regardless of how many times the same zodiac signs appear among the drawn numbers, you win only once.\nWinning example: Betting scheme: Dragon, Tiger, Rat; Drawn numbers include numbers corresponding to the Dragon, Tiger, and Rat zodiac signs, you win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
(434, '4 Consec zodiac', 'active', 128, 8, 'Same line extra & Ball Zodiac', '[30.1934,36.338299999999997]', 'Game instructions: Select four zodiac signs to form one bet. If the zodiac signs corresponding to any of the seven winning numbers include all four of these selected zodiac signs (in any order), you win. If the bet does not include a zodiac sign from the current zodiac year, you win the first prize; if it includes the current zodiac year, you win the second prize. Regardless of how many times the same zodiac signs appear among the drawn numbers, you win only once.\nWinning example: Betting scheme: Dragon, Tiger, Rat, Rabbit; Drawn numbers include numbers corresponding to the Dragon, Tiger, Rat, and Rabbit zodiac signs, you win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[4]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
(435, '5 Consec zodiac', 'active', 128, 8, 'Same line extra & Ball Zodiac', '[105.93492000000001,128.85898]', 'Game instructions: Select five zodiac signs to form one bet. If the zodiac signs corresponding to any of the seven winning numbers include all five of these selected zodiac signs (in any order), you win. If the bet does not include a zodiac sign the current zodiac year, you win the first prize; if it includes a sign from the current zodiac year, you win the second prize. Regardless of how many times the same zodiac signs appear among the drawn numbers, you win only once.\nWinning example: Betting scheme: Dragon, Tiger, Rat, Rabbit, Pig; Drawn numbers include numbers corresponding to the Dragon, Tiger, Rat, Rabbit, and Pig zodiac signs, you win.', '12', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[5]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
