(438, 'Color Balls', 'active', 129, 8, 'Color Balls', '[2.7519800000000001,3.1414200000000001,34.327109999999998]', 'Game instructions: Place a bet on one color ball, forming one bet. The color that appears the most among the seven color balls winning numbers wins. Each of the six regular numbers counts as one color ball, while the special number(Extra number) counts as 1.5 color ball. The following three scenarios are considered ties:\n\nSix regular numbers result in 3 blue balls and 3 green balls, and the special number(Extra number) is a red ball.\nSix regular numbers result in 3 blue balls and 3 red balls, and the special number(Extra umber) is a green ball.\nSix regular numbers result in 3 green balls and 3 red balls, and the special number(Extra number) is a blue ball.\nIn case of a tie, all bets on red, green, and blue color balls are refunded; betting on a tie is also available.\n\nWinning example: Betting scheme: Red ball; Winning numbers have red ball numbers the most, you win.', '1', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', NULL, NULL, NULL, NULL, NULL, NULL, 1, 1, 'mark6', '', 'false', '', ''),
