(462, 'Pick 1', 'active', 153, 10, 'Pick', '[4]', 'Game instructions: Choose one number to form one bet. If the Winning numbers include the selected number, you win.\nWinning example: Betting scheme: 01; Winning numbers: The Winning numbers include 01, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 1, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(463, 'Pick 2', 'active', 153, 10, 'Pick', '[16.63147]', '\nGame instructions: Choose two numbers to form one bet. If the Winning numbers include both selected numbers, you win.\n\nWinning example: Betting scheme: 01, 02; Winning numbers: The Winning numbers include both 01 and 02, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(464, 'Pick 3', 'active', 153, 10, 'Pick', '[4, 32.07005]', 'Game instructions: Choose three numbers to form one bet. If the Winning numbers include all three selected numbers, you win "Three of a kind"; if they include two of the selected numbers, you win "Two of a kind". You cannot win all simultaneously.\n\nWinning example: Betting scheme: 01, 02, 03; Winning numbers: The Winning numbers include 01, 02, 03, or at least two of these numbers, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(465, 'Pick 4', 'active', 153, 10, 'Pick', '[2, 10, 46.43543]', 'Game instructions: Choose four numbers to form one bet. If the Winning numbers include all four selected numbers, you win "Four of a kind"; if they include three of the selected numbers, you win "Three of a kind"; if they include two of the selected numbers, you win "Two of a kind". You cannot win all simultaneously.\n\nWinning example: Betting scheme: 01, 02, 03, 04; Winning numbers: The winning numbers include 01, 02, 03, 04, or at least two of these numbers, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(466, 'Pick 5', 'active', 153, 10, 'Pick', '[4, 40, 279.9802]', 'Game instructions: Choose five numbers to form one bet. If the drawn numbers include all five selected numbers, you win "Five of a kind"; if they include four of the selected numbers, you win "Four of a kind"; if they include three of the selected numbers, you win "Three of a kind". You cannot win all simultaneously.\n\nWinning example: Betting scheme: 01, 02, 03, 04, 05; Winning numbers: The Winning numbers include 01, 02, 03, 04, 05, or at least three of these numbers, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(467, 'Pick 6', 'active', 153, 10, 'Pick', '[4, 8, 50, 756.96061]', 'Game instructions: Choose six numbers to form one bet. If the Winning numbers include all six selected numbers, you win "Six of a kind"; if they include five of the selected numbers, you win "Five of a kind"; if they include four of the selected numbers, you win "Four of a kind"; if they include three of the selected numbers, you win "Three of a kind". You cannot win all simultaneously.\n\nWinning example: Betting scheme: 01, 02, 03, 04, 05, 06; Winning numbers: The Winning numbers include 01, 02, 03, 04, 05, 06, or at least three of these numbers, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(468, 'Pick 7', 'active', 153, 10, 'Pick', '[2, 4, 25, 160, 8810.25482]', 'Game instructions: Choose seven numbers to form one bet. If the drawn numbers include all seven selected numbers, you win "Seven of a kind"; if they include six of the selected numbers, you win "Six of a kind"; if they include five of the selected numbers, you win "Five of a kind"; if they include four of the selected numbers, you win "Four of a kind"; if they include none of the selected numbers, you win "Zero of a kind". You cannot win all simultaneously.\n\nWinning example: Betting scheme: 01, 02, 03, 04, 05, 06, 07; Winning numbers: The winning numbers do not include 01, 02, 03, 04, 05, 06, 07, or include four or more of these numbers, you win.', '80', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 2, 1, 80, 0, 0, 1, 1, 2, 'button', '["Over","Under"]', 'false', '', ''),
(469, 'First 3 straight(joint)', 'active', 155, 6, 'Straight', '[990]', '\nGame instructions: Choose one unique number from each of the first, second, and third positions to form a bet. If the selected numbers match the first three numbers of the winning numbers in the exact order, you win.\n\nWinning example: Betting scheme: 01, 02, 03; Winning numbers: 01, 02, 03, *, *, you win.', '990', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 11, 1, 1, 1, 1, 3, 'button', '["1st","2nd","3rd"]', 'false', '', ''),
(470, 'First 3 straight(manual)', 'active', 155, 6, 'Straight', '[990]', '\nGame instructions: Enter three non-repeating numbers from 01 to 11. If the entered numbers match the first three digits of the winning numbers in the exact order, you win.\n\nWinning example: Betting scheme: 010203; Winning numbers: 01, 02, 03, *, *, you win.', '990', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 11, 1, 1, 1, 1, 3, 'manual', '[]', 'false', '', ''),
(471, 'Over/Under', 'active', 154, 10, 'Fun', '[2.5101,4.9201]', 'Game instructions: Choose one category to form one bet. In a set of 20 drawn numbers, if the count of numbers in the upper range (01-40) is greater than the count of numbers in the lower range (41-80), it''s called "Over"; otherwise, it''s called "Under". If the counts are equal, it''s called "Tie". If the count of drawn numbers matches the selected category, you win.\n\nWinning example: Betting scheme: Over; Winning numbers: There are more numbers in the upper range than in the lower range among the winning numbers, you win.', '3', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, NULL, NULL, 0, 0, 0, 1, 1, 'happy8', '', 'true', '', ''),
(472, 'Odd/Even', 'active', 154, 10, 'Fun', '[2.5100500000000001,4.9200999999999997]', '\nGame instructions: Choose one odd-even category to form one bet. Among 20 drawn numbers, if the count of odd numbers (ones place being 1, 3, 5, 7, 9) is greater than the count of even numbers (ones place being 0, 2, 4, 6, 8), it''s called "Odd"; otherwise, it''s called "Even". If the count of odd and even numbers is equal, it''s called "Tie". If the count of odd and even numbers in the drawn Winning matches the selected category, you win.\n\nWinning example: Betting scheme: Odd; Winning numbers: There are more odd numbers than even numbers among the Winning numbers, so you win.', '3', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, NULL, NULL, 0, 0, 0, 1, 1, 'happy8', '', 'true', '', ''),
(473, 'B/S/O/E of Sum', 'active', 154, 10, 'Fun', '[2]', 'Game instructions: Choose one category (Big: >810; Small: <810). If the sum of the 20 drawn numbers matches the selected category and its value is greater than 810 for Big or less than 810 for Small, you win. If the sum is exactly 810, the bet is refunded. Additionally, choose Odd (Odd digit: 1, 3, 5, 7, 9) or Even (Even digit: 0, 2, 4, 6, 8). If the sum of the 20 drawn numbers matches the selected category and its value is greater than 810 for Big or less than 810 for Small, you win.\n\nWinning example: Betting scheme: Big; Winning numbers: The sum of the Winning numbers is greater than 810, so you win.', '4', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1]', 1, NULL, NULL, 0, 0, 0, 1, 1, 'happy8', '', 'false', '', ''),
(474, 'First 3 Group(joint)', 'active', 155, 6, 'Group', '[165]', 'Game instructions: Select three numbers to form a bet. If the selected numbers match the first three numbers of the winning numbers in any order, you win.\n\nWinning example: Betting scheme: 01, 02, 03; Winning numbers: 01, 03, 02, *, *, you win.', '165', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 1, 1, 11, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(475, 'First 3 Group(Manual)', 'active', 155, 6, 'Group', '[165]', 'Game instructions: Enter three non-repeating numbers from 01 to 11 to form a bet. If the entered numbers match the first three digits of the winning numbers in any order, you win.\n\nWinning example: Betting scheme: 010203; Winning numbers: 01, 03, 02, *, *, you win.', '165', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1,1]', 3, 1, 11, 0, 1, 0, 1, 1, 'manual', '', 'false', '', ''),
(476, 'First 2 straight(joint)', 'active', 156, 6, 'Straight', '[110]', 'Game instructions: Choose one unique number from each of the first and second positions to form a bet. If the selected numbers match the first two numbers of the winning numbers in the exact order, you win.\n\nWinning example: Betting scheme: 01, 02; Winning numbers: 01, 02, *, *, *, you win.', '110', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 1, 11, 1, 1, 1, 1, 2, 'button', '["1st","2nd"]', 'false', '', '');
