(1411, 'Pick 4 Group 24', 'active', 15, 1, 'Group', '[416.6666]', 'Game Instructions: Choose any four positions from the 1st, 2nd, 3rd, 4th and 5th and select four numbers to form one bet. If the winning numbers in the selected four positions match the chosen numbers (order doesn''t matter), then you win.\nWinning Example: Betting scheme: (1st, 2nd, 3rd, 4th) 1234; Winning numbers: 4,1,3,2,* — you win.', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[4]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(1421, 'Pick 4 Group 12', 'active', 15, 1, 'Group', '[833.3333]', 'Game Instructions: Choose any four positions from the 1st, 2nd, 3rd, 4th and 5th select one pair and two single numbers to form one bet. If in the selected four positions of the winning numbers, the pair appears twice, and each single number appears once, then you win.\nWinning Example: Betting scheme: (1st, 2nd, 3rd, 4th) Pair: 3, Single numbers: 1,2; Winning numbers: 3,1,2,3,* — you win.', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,2]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["One Pair","One No."]', 'false', '', ''),
(1431, 'Pick 4 Group 6', 'active', 15, 1, 'Group', '[1666.6666]', 'Game Instructions: Choose any four positions from the 1st, 2nd, 3rd, 4th and 5th, and select two pairs to form one bet. If in the selected four positions of the winning numbers, each pair appears twice, then you win.\nWinning Example: Betting scheme: (1st, 2nd, 3rd, 4th) 2,8; Winning numbers: 2,8,2,8,* — you win.', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[2]', 1, 0, 9, 0, 1, 0, 1, 1, 'button', '[]', 'false', '', ''),
(1441, 'Pick 4 Group 4', 'active', 15, 1, 'Group', '[2500]', 'Game Instructions: Choose any four positions from the 1st, 2nd, 3rd, 4th and 5th, and select one triple number and one single number to form one bet. If in the selected four positions of the winning numbers, the triple number appears three times and the single number appears once, then you win.\nWinning Example: Betting scheme: (1st, 2nd, 3rd, 4th) Triple number: 1, Single number: 2; Winning numbers: 1,2,1,1,* — you win.', '50000', 'standard', '0.000', '15.000', '15.000', '0.000', 2000, 1700, '[1,1]', 2, 0, 9, 0, 1, 1, 1, 2, 'button', '["Three of a Kind","One No."]', 'false', '', '');
