(169, 'Conv B/S/O/E', 'active', 137, 8, 'Conv B/S/O/E', '0.000', NULL, 'B/S Extra No.: Extra No. draw ≥ 25 as "Big"; ≤ 24 as "Small"; Extra No. 49 as Tie, refund.\r\nO/E Extra No.: Extra No. last digit draw 1, 3, 5, 7, 9 as "Odd"; 0, 2, 4, 6, 8 as "Even"; Extra No. 49 as Tie, refund.\r\nB/S Sum of Extra head&tail: Sum of 1st and 2nd Extra No. draw ≥ 7 as "Sum B"; ≤ 6 as "Sum S";\r\nExtra No. 49 as Tie, refund. E.g. Extra No. 07, Bet「Sum B」\r\nO/E Sum of extra head&tail: Sum of 1st and 2nd Extra No. last digit draw as 1, 3, 5, 7, 9 as "Sum O"; 0, 2,4, 6, 8 as "Sum E." Extra No. 49 as Tie, refund.\r\nExtra No.: Sky/ground Zodiac: Ox, Rabbit, Dragon, Horse, Monkey, Pig Zodiac Extra No. as "Sky Zodiac";\r\nRat, Tiger, Snake, Goat, Cock, Dog as "Ground Zodiac"; Extra No. 49 as Tie, refund.\r\nExtra No.: First, Last Zodiac: Rat, Ox, Tiger, Rabbit, Dragon, Snake Zodiac Extra No. as "First Zodiac";\r\nHorse, Goat, Monkey, Cock, Dog, Pig as "Last Zodiac"; Extra No. 49 as Tie, refund.\r\nExtra No.: Poultry, Beast Zodiac: Ox, Horse, Goat, Cock, Dog, Pig Zodiac Extra No. as "Poultry Zodiac";\r\nRat, Tiger, Dragon, Snake, Rabbit, Monkey as "Beast Zodiac"; Extra No. 49 as Tie, refund.\r\nB/S Extra tail: Extra No. ≥ 5 as "Big tail"; ≤ 4 as "Small tail"; Extra No. 49 as Tie, refund.\r\nB/S/O/E Extra No.:Extra No. ≥ 25 as "Big"; ≤ 24 as "Small." Extra No. 1, 3, 5, 7, 9 as "Odd"; 0, 2, 4, 6, 8 as "Even";\r\nExtra No. 49 as Tie, refund.\r\nB/S, O/E combo generate「Big Odd」,「Small Odd」,「Big Even」,「Small Even」, 4 combo.\r\nE.g. Extra No. 48; Bet 「Big Odd」, as win.', '8', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 10),
