(172, 'Ball No.', 'active', 139, 8, 'Ball No.', '0.000', NULL, 'Color: 49 No. split into Red, Blue, Green. Selected and Extra No. color same, as win.\r\nRed balls 01 ,02 ,07 ,08 ,12 ,13 ,18 ,19 ,23 ,24 ,29 ,30 ,34 ,35 ,40 ,45 ,46\r\nBlue balls 03 ,04 ,09 ,10 ,14 ,15 ,20 ,25 ,26 ,31 ,36 ,37 ,41 ,42 ,47 ,48\r\nGreen balls 05 ,06 ,11 ,16 ,17 ,21 ,22 ,27 ,28 ,32 ,33 ,38 ,39 ,43 ,44 ,49\r\n2 Side Color: Color combine with Big, Small, Odd, Even,as 2 Side Color. ≥ 25 as "Big"; ≤ 24 as "Small";\r\n1, 3, 5, 7, 9 as "Odd"; 0, 2, 4, 6, 8 as "Even." Selected and Extra No. 2 Side Color same, as win.\r\nExtra No. 49 as Tie, refund. E.g. Extra No. 48, bet 「Big Blue」as win.\r\n4 Side Color: Color combine with Big Odd, Small Even, Small Odd, Small Even,as 4 Side Color.\r\nSelected and Extra No. 4 Side Color same, as win. Extra No. 49 as Tie, refund.\r\nE.g. Extra No. 48, bet 「Big Blue Even」as win.', '49', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 49),
