(174, 'Row Zodiac Row Tail 2 Consec Zodiac ', 'active', 141, 8, 'Row Zodiac Row Tail 2 Consec Zodiac', '0.000', NULL, '2Row Zodiac ~ 5Row Zodiac\r\n7 No. Zodiac draw include selected, as win. Bet combo include Natal Zodiac and its odds. No matter how often same Zodiac No., only win once.\r\n2 Row Zodiac: Select 2 Zodiac form 1bet.\r\nE.g. winning No. occur Dragon, Tiger No. Bet「Dragon, Tiger」as win.\r\n3 Row Zodiac: Select 3 Zodiac form 1bet.\r\nE.g. winning No. occur Dragon, Tiger, Rat No. Bet「Dragon, Tiger, Rat」as win.\r\n4 Row Zodiac: Select 4 Zodiac form 1bet.\r\nE.g. winning No. occur Dragon, Tiger, Rat, Rabbit No. Bet「Dragon, Tiger, Rat, Rabbit」as win.\r\n5 Row Zodiac: Select 5 Zodiac form 1bet.\r\nE.g. winning No. occur Dragon, Tiger, Rat, Rabbit, Pig No. Bet「Dragon, Tiger, Rat, Rabbit, Pig」as win.\r\n2Row Tail ~ 5Row Tail\r\n7 No. Zodiac draw include selected, as win. Bet combo include 0 tail and its odds. No matter how often same tail No., only payout once.\r\n2 Row Tail: Select 2 tail as 1bet.\r\nE.g. Winning No. 10,20,30,41,42,43+44, bet「0 tail, 1 tail」as win.\r\n3 Row Tail: Select 3 tail as 1bet.\r\nE.g. Winning No. 10,20,30,41,42,43+44, bet「0 tail, 1 tail, 2 tail」as win.\r\n4 Row Tail: Select 4 tail as 1bet.\r\nE.g. Winning No. 10,20,30,41,42,43+44, bet「0 tail, 1 tail, 2 tail, 3 tail」as win.\r\n5 Row Tail: Select 5 tail as 1bet.\r\nE.g. Winning No. 10,20,30,41,42,43+44, bet「0 tail, 1 tail, 2 tail, 3 tail, 4 tail」as win.', '12', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(175, 'Row No.', 'active', 142, 8, 'Row No.', '[24.7301,123.65096]', NULL, 'Win4: Select 4 No. form 1bet. Ball No. include selected, as win.\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,02,03,04」as win.\r\nWin3: Select 3 No. form 1bet. Ball No. include selected, as win.\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,02,03」as win.\r\nWin 2/3: Select 3 No. form 1bet. Ball No. include selected, as win 3/3; Include 2 of selected as win 2/3.\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,02,03」as win.\r\nWin2/2: Select 2 No. form 1bet. Ball No. include selected, as win.\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,02」as win.\r\n2No.: Select 2 No. form 1bet. Winning No. Ball No. include selected, as win "2 Ball No.". 1 Ball No., 1 Extra No., as win "Win Extra"\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,02」as win.\r\nWin Extra No.: Select 2 No. form 1bet. Any 1 Ball No., 1 Extra No., as win.\r\nE.g. Winning No. 01,02,03,04,05,06+07, bet「01,07」as win.', '49', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 49),
