(192, '2Sides Sum', 'active', 161, 10, 'Sum', '0.000', NULL, 'B/S: Sum of winning No. > 810 as "Big"; < 810 as "Small"; 810 as Tie, refund.\r\nO/E: Sum of winning No. unit digit at 1, 3, 5, 7, 9 as "Odd"; 0, 2, 4, 6, 8 as "Even."', '2', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(193, '2Sides Sum Pass', 'active', 161, 10, 'Sum Pass', '0.000', NULL, 'Sum of winning No. > 810 as ""Big""; < 810 as ""Small""; 1, 3, 5, 7, 9 as ""Odd""; 0, 2, 4, 6, 8 as ""Even""; 810 as Tie, will refund.\r\nB/S, O/E combo generate「Big Odd」,「Small Odd」,「Big Even」,「Small Even」, 4 combo.\r\nE.g. Sum of winning No. 811; Bet 「Big Odd」, as win.', '2', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(194, '2Sides More First/Last', 'active', 161, 10, 'More First/Last', '0.000', NULL, 'Winning No. 01-40 as "First"; 41-80 as "Last." Winning No. "First" more as 「More First」; Or else 「More Last」; Equal will refund.', '1', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(195, '2Sides More Odd/Even', 'active', 161, 10, 'More Odd/Even', '0.000', NULL, 'Winning No. unit digit at 1, 3, 5, 7, 9 as Odd; 0, 2, 4, 6, 8 as Even. Odd more than even as 「More Odd」; Or else 「More Even」; Equal will refund.', '1', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(196, '2Sides 5 Elements', 'active', 161, 10, '5 elements', '0.000', NULL, '5 part of 20 draw No., rename as Gold (210-695), Wood (696-763), Water (764-856), Fire (857·924), Earth (925-1410).\r\nE.g. sum of winning No. 693; Bet 「Gold」, as win.', '5', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 0),
(197, 'Ball No.', 'active', 162, 10, 'Ball No', '0.000', NULL, '"Bet 1 No. and any of 20 draw No. same, as win.\nE.g. winning No. 01*******************; Bet「01」as win."', '80', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 80),
(198, 'Rapido B/S/O/E', 'active', 163, 6, 'Rapido', '0.000', NULL, 'Select a No. place, and bet a element. when selected and winning No. element place are the same, as win.\r\nB/S: Winning No. > 6 as "B"; ≤ 5 as "S"; 11 as Tie (Refund).\r\nO/E: winning No. units digit at 1, 3, 5, 7, 9 as "O"; 0, 2, 4, 6, 8 as "E";11 as Tie (Refund).', '2', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 1),
(199, 'Fixed place', 'active', 163, 6, 'Rapido', '0.000', NULL, 'Select 1 No. from any of 1st~5th place. Selected and winning No. place same, as win.\r\nE.g. Winnning No. 01, *, *, *, *; Bet 「1st as 01」as win.', '11', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 1),
(200, ' B/S/O/E', 'active', 164, 6, 'Sum', '0.000', NULL, 'Sum B/S: Sum of winning No. > 30 as Big, < 30 as Small, 30 as Tie; refund.\r\nSum O/E : Sum of winning No. Units digit at 1, 3, 5, 7, 9 as Odd; ended with 0, 2, 4, 6, 8 as Even.\r\n', '2', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 1),
(201, 'D/T/TB/TS', 'active', 164, 6, 'Sum', '0.000', NULL, 'Sum of Tails: Sum of winning No. Units digit ≥ 5 as Big; ≤ 4 as Even.\r\nD/T：1st winning No. > 5th winning No. (0 smallest, 9 biggest) as D, or else T.', '2', NULL, '0.000', '15.000', '15.000', '0.000', 2000, 1700, 1),
(202, 'Fixed Place', 'active', 164, 6, 'Fixed Place', '0.000', NULL, 'Select 1 No. from any of 1st~5th place. Selected and winning No. place same, as win.\r\nE.g. Winnning No. 01, *, *, *, *; Bet 「1st as 01」as win.', '64', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 5),
(203, 'Pick1', 'active', 165, 6, 'Pick', '0.000', NULL, 'Pick 1: Select 1 No. form 1bet. Winning No. include selected, as win.\r\nE.g. Winning No. 01, *, *, *, *; Bet「01, 02」as win.', '11', 'twosides', '0.000', '15.000', '15.000', '0.000', 2000, 1700, 1),
